export const MenuBar = () => {
  return (
    <svg
      width="18"
      height="15"
      viewBox="0 0 18 15"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <rect className="path" width="18" height="3" rx="1" fill="white" />
      <rect className="path" y="6" width="18" height="3" rx="1" fill="white" />
      <rect className="path" y="12" width="18" height="3" rx="1" fill="white" />
    </svg>
  );
};
